      {
        id: "2",
        title: "title_2",
        album: "album_2",
        author: "author_2",
      },
    ];
    return musicList;
  }



  return (
    <div>
      <section>
        <Header/>
      </section>
      <section>
        <button onClick={fetchHandler}/>
        <MusicList music={musicList} />
      </section>
    </div>
  );
}

export default App;
